import React from 'react';
import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  StyleSheet,
  Dimensions,
  Platform,
  Linking
} from 'react-native';
import { useNavigate } from 'react-router-dom';
import Footer from '../components/Footer';

const { width } = Dimensions.get('window');

const Careers = () => {
  const navigate = useNavigate();

  const handleBackToHome = () => {
    navigate('/');
  };

  const handleContact = () => {
    navigate('/#contact');
  }

  return (
    <View style={styles.container}>
      <View style={styles.navHeader}>
        <TouchableOpacity onPress={handleBackToHome} style={styles.backButton}>
          <Text style={styles.backArrow}>←</Text>
          <Text style={styles.backText}>Back to Home</Text>
        </TouchableOpacity>
      </View>

      <ScrollView
        style={styles.scrollView}
        contentContainerStyle={styles.scrollContent}
        showsVerticalScrollIndicator={false}
      >
        <View style={styles.heroSection}>
          <Text style={styles.pageTitle}>PARTNERSHIPS</Text>
          <View style={styles.fireBar} />
          <Text style={styles.pageSubtitle}>
            Building the future of startups, together
          </Text>
        </View>

        <View style={styles.introSection}>
          <Text style={styles.introText}>
            I'm always open to collaborating with like-minded founders, investors, and industry experts. If you have a project or idea that could benefit from my unique blend of technical and business expertise, I'd love to hear from you.
          </Text>
        </View>

        <View style={styles.benefitsContainer}>
          <Text style={styles.benefitsTitle}>Why Partner With Me?</Text>
          <View style={styles.benefitsGrid}>
            <View style={styles.benefitItem}>
              <Text style={styles.benefitText}>A True Technical Co-Founder</Text>
            </View>
            <View style={styles.benefitItem}>
              <Text style={styles.benefitText}>Accelerated MVP Development</Text>
            </View>
            <View style={styles.benefitItem}>
              <Text style={styles.benefitText}>Strategic Product Direction</Text>
            </View>
            <View style={styles.benefitItem}>
              <Text style={styles.benefitText}>Investor & Network Access</Text>
            </View>
          </View>
        </View>

        <TouchableOpacity
          style={styles.applyButton}
          onPress={handleContact}
        >
          <Text style={styles.applyButtonText}>Let's Connect</Text>
          <Text style={styles.applyArrow}>→</Text>
        </TouchableOpacity>

        <Footer />
      </ScrollView>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F5F5F5',
  },
  navHeader: {
    paddingTop: Platform.OS === 'web' ? 40 : 60,
    paddingHorizontal: width > 768 ? 40 : 20,
    paddingBottom: 20,
    borderBottomWidth: 1,
    borderBottomColor: '#DDDDDD',
    backgroundColor: 'rgba(245, 245, 245, 0.8)',
  },
  backButton: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  backArrow: {
    fontSize: 24,
    color: '#00A8E8',
    marginRight: 10,
  },
  backText: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: 16,
    color: '#00A8E8',
    fontWeight: '600',
  },
  scrollView: {
    flex: 1,
  },
  scrollContent: {
    flexGrow: 1,
  },
  heroSection: {
    paddingVertical: 60,
    paddingHorizontal: width > 768 ? 40 : 20,
    alignItems: 'center',
  },
  pageTitle: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 36 : 24,
    color: '#1A1A1A',
    textAlign: 'center',
    marginBottom: 20,
    fontWeight: '700',
  },
  pageSubtitle: {
    fontFamily: Platform.OS === 'web' ? "'Roboto', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 18 : 14,
    color: '#333333',
    textAlign: 'center',
  },
  fireBar: {
    height: 4,
    width: 80,
    backgroundColor: '#00A8E8',
    marginBottom: 20,
    borderRadius: 2,
  },
  introSection: {
    paddingHorizontal: width > 768 ? 40 : 20,
    marginBottom: 50,
  },
  introText: {
    fontFamily: Platform.OS === 'web' ? "'Roboto', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 16 : 14,
    color: '#333333',
    textAlign: 'center',
    maxWidth: 700,
    alignSelf: 'center',
    lineHeight: 28,
  },
  applyButton: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: '#00A8E8',
    paddingVertical: 15,
    paddingHorizontal: 30,
    borderRadius: 8,
    alignSelf: 'center',
    marginBottom: 60,
  },
  applyButtonText: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: 12,
    color: '#FFFFFF',
    fontWeight: '700',
    marginRight: 8,
  },
  applyArrow: {
    fontSize: 18,
    color: '#FFFFFF',
  },
  benefitsContainer: {
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    padding: 30,
    maxWidth: 900,
    alignSelf: 'center',
    borderWidth: 1,
    borderColor: '#EEEEEE',
    marginHorizontal: width > 768 ? 40 : 20,
    marginBottom: 60,
  },
  benefitsTitle: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 20 : 16,
    color: '#1A1A1A',
    textAlign: 'center',
    marginBottom: 30,
    fontWeight: '700',
  },
  benefitsGrid: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: 20,
  },
  benefitItem: {
    alignItems: 'center',
    width: width > 768 ? 200 : (width - 80) / 2,
    padding: 20,
    borderRadius: 8,
    backgroundColor: '#F5F5F5',
    borderWidth: 1,
    borderColor: '#EEEEEE',
  },
  benefitText: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: 13,
    color: '#333333',
    textAlign: 'center',
    fontWeight: '600',
  },
});

export default Careers;
